import React from 'react';

export const Footer = () => {
    return (
        <footer className="footer">
            <div className="footer-container">
                <p className="footer-text">&copy; {new Date().getFullYear()} Sheily Shah. All rights reserved.</p>
                <p className="footer-text"><a href="/release-notes" className="footer-link">Release Notes</a></p>
                <p className="footer-text"><a href="https://github.com/your-github-repo" className="footer-link" target="_blank" rel="noopener noreferrer">GitHub</a></p>
            </div>
        </footer>
    );
}
